import React from "react";
import "../Bootstrap.css";
import styled from "styled-components";

import {
    Media,
    Col,
    } from 'reactstrap';


const Circles = () => {
    return (
      <HeaderDiv>
        <Circle>
            <Dot></Dot>
        </Circle>
        <Circle>
            <Dot></Dot>
        </Circle>
        <Circle>
            <Dot></Dot>
        </Circle>
      </HeaderDiv>
    );
  };


const Dot = styled.div`
    width: 6px;
    height: 6px;
    display: flex;
    justify-content: center;
    border-radius: 50%;
    background-color: #6E95B5;
`;

const HeaderDiv = styled.div`
    display: flex;
    justify-content: center;
    margin: 20px;
`;

const Circle = styled.div`
    width: 46px;
    height: 46px;
    padding: 20px 20px;
    background-color: #CDDBE5;
    border-radius: 50%;
    float: left;
    margin: 40px;
`;

export default Circles;
